// OnLoad Client Script showing how to use GlideAjax (server lookup)
// Prompt: If the user is not part of the Facilities Group, remove "office" from the type of access choice.
function onLoad(){
    var userAjax = new GlideAjax('global.UserAjax'); // make a ajax call to script include UserAjax
    userAjax.addParam('sysparm_name', 'getGroups'); // call the getGroups function
    userAjax.addParam('sysparm_obj', JSON.stringify({"userId": g_user.userId})); //pass in the logged in user's id
    userAjax.getXML(function(response){ // handle the response
        var answer = response.responseXML.document.Element.getAttribute('answer'); // get the answer
        var serverObj = JSON.parse(answer); // make the response an object
        var notPartOfFacilities = serverObj.groups.indexOf('Facitilites Group') == -1; // if groups does not contain facilities
        if(notPartOfFacilities){
            g_form.removeOption('office','access'); // remove this option
        }
    })
}

This code checks if the priority is set to 1, generally this means High in ServiceNow.
If the priority is high, set the group field to the current (current record's) manager's group.
There are other ways to do this.
You could use flow designer and pills.
You could use a scriptless business rule.  For a scriptless business rule you'll have to create a dynamic filter (with script).

```js
(function executeRule(current, previous) {
    if (current.getValue('priority', '1')) {
        current.setValue('group', current.manager.group + '');
    }
})(current, previous);
```
